
import {ActionType, FollowActionType, SetUsersActionType, UnfollowActionType} from "./usingTypes";

export const FOLLOW = 'FOLLOW';
export const UNFOLLOW = 'UNFOLLOW';
export const SET_USERS = 'SET-USERS';

export type LocationType = {
    city: string
    country: string
}
export type PhotosType = {
    small: string
    large: string
}

export type UserType = {
    id: string
    name: string
    status: string,
    location: LocationType
    followed: boolean
    photos: PhotosType
}

type InitialStateType = {
    users: Array<UserType>
}

const initialState = {
    users: [
        // {id: v1(), fullName: 'Sergey', status: 'Hi guys', photoUrl: 'data:image/png;base64,',
        // location: {city: 'Kiev', country: 'Ukraine'}, followed: false},
        // {id: v1(), fullName: 'Sveta', status: 'I am a boss too', photoUrl: 'data:image/jpeg;base64,',
        //     location: {city: 'Moscow', country: 'Russia'}, followed: false},
        // {id: v1(), fullName: 'Dmitry', status: 'I am a boss', photoUrl: 'data:image/jpeg;base64,',
        //     location: {city: 'Minsk', country: 'Belarus'}, followed: false},
    ],
};

const usersReducer = (state: InitialStateType = initialState, action: ActionType) => {
    switch (action.type) {
        case FOLLOW:
            return {
                ...state,
                users: state.users.map(u => {
                    if (u.id === action.id) {
                        return {...u, followed: true}
                    }
                    return u;
                }),
            }
        case UNFOLLOW:
            return {
                ...state,
                users: state.users.map(u => {
                    if (u.id === action.id) {
                        return {...u, followed: false}
                    }
                    return u;
                }),
            }
        case SET_USERS: {
            debugger
            let newVar = {...state, users: [...state.users, ...action.users]};
            return newVar
        }
        default:
            return state;
    }
}

export const followAC = (userId: string):FollowActionType => (
    {type: FOLLOW, id: userId})

export const unfollowAC = (userId: string): UnfollowActionType => (
    {type: UNFOLLOW, id: userId})

export const setUsersAC = (users: Array<UserType>): SetUsersActionType => (
    {type: SET_USERS, users})

export default usersReducer;